import React from "react";
import "./style.css";

function Resume() {
  return (
    <div>

        <div className="col-sm-12 col-md-12 col-lg-12 col-xl-12 justify-content-sm-center">
          <div className="wrapper position-relative mb-4">
            <a href="https://github.com/eurbaezjr/home-work-7/blob/master/Eduardo%20Urbaez's%20Resume%202019.docx?raw=true">
              <img className="img-fluid" id="geek-image"
                src="https://www.visaplace.com/blog-immigration-law/wp-content/uploads/2018/04/7542207D-08FB-41DE-B6AD-CBB4827330F0.jpeg"
                alt="Resume" />
              <div className="box-1 position-absolute">Resume</div>
            </a>
          </div>
        </div>

    </div>
  );
}

export default Resume;
